#include "common.h"
using namespace std;

namespace minKBitFlips {
/*
// TODO: copy problem statement here
 995. Minimum Number of K Consecutive Bit Flips
 Hard
 
 157
 
 21
 
 Favorite
 
 Share
 In an array A containing only 0s and 1s, a K-bit flip consists of choosing a (contiguous) subarray of length K and simultaneously changing every 0 in the subarray to 1, and every 1 in the subarray to 0.
 
 Return the minimum number of K-bit flips required so that there is no 0 in the array.  If it is not possible, return -1.
 
 
 
 Example 1:
 
 Input: A = [0,1,0], K = 1
 Output: 2
 Explanation: Flip A[0], then flip A[2].
 Example 2:
 
 Input: A = [1,1,0], K = 2
 Output: -1
 Explanation: No matter how we flip subarrays of size 2, we can't make the array become [1,1,1].
 Example 3:
 
 Input: A = [0,0,0,1,0,1,1,0], K = 3
 Output: 3
 Explanation:
 Flip A[0],A[1],A[2]: A becomes [1,1,1,1,0,1,1,0]
 Flip A[4],A[5],A[6]: A becomes [1,1,1,1,1,0,0,0]
 Flip A[5],A[6],A[7]: A becomes [1,1,1,1,1,1,1,1]
 
 
 Note:
 
 1 <= A.length <= 30000
 1 <= K <= A.length
 */

class Solution {
public:
    /**
     * use queue size to represent # of flips done.
     * Also, the value at the queue front is the index at which it should be popped.
     */
    int minKBitFlips(vector<int>& A, int k) {
        int l=A.size();
        int res=0;
        queue<int> q;
        for(int i=0;i<l;i++)
        {
            if((A[i]==0 && q.size()%2==0) || (A[i]==1 && q.size()%2==1) )
            {
                res++;
                q.push(i+k-1);
                
            }
            if(!q.empty() && q.front() <= i)
                q.pop();
        }
        if(q.empty())
            return res;
        return -1;
        
    }
    /**
     * Use max interval overlap to count how many flips are at each position.
     */
    int minKBitFlips_activeIntervalCount(vector<int>& A, int K) {
        int n = A.size();
        unordered_map<int,int> cnt;
        int res = 0;
        int cur = 0;
        int i = 0;
        for (; i <= n-K; ++i) {
            cur += cnt[i];
            if (!(A[i]^(cur%2))) {
                ++cur;
                --cnt[i+K];
                ++res;
            }
        }
        // now check the leftover bits
        for (; i < n; ++i) {
            cur += cnt[i];
            if (!(A[i] ^ (cur%2))) {
                return -1;
            }
        }
        return res;
    }
    /**
     * This would TLE!
     * when K is big and it is like "1010101010101...", then
     * time complexity = O(n*K).
     */
    int minKBitFlips_TLE(vector<int>& A, int K) {
        int n = A.size();
        int one = 0;
        for (auto i : A) {
            one += i;
        }
        // if K is even, then 1's oddity and 0's oddity will not change.
        // so there has to be an even # of 0's as we need to flip it into 0 0's.
        if (((n-one)%2 == 1) && (K%2 == 0)) {
            return -1;
        }
        // TODO: how to flip? always flip the left most 0? this sounds too simple!
        int res = 0;
        int n0 = 0;
        while (n0 < n) {
            if (!A[n0]) {
                // do flip starting at n0
                if (n-n0 < K) {
                    return -1;
                }
                for (int i = 0; i < K; ++i) {
                    A[n0+i] ^= 1;
                }
                ++res;
            }
            ++n0;
        }
        
        return res;
    }

private:
};

}

